/*@flow*/
import React from 'react';
let T = React.PropTypes;
let lastTable=[];
let  Layer=React.createClass({
    propTypes:{
       choosedTool: T.func,
       fontSetting: T.func,
       rotateAngle: T.func,
       lineSetting: T.func,
       shapeSetting:T.func,
       shapeColorSetting:T.func,
    },
    getInitialState() {
        return {};
    },
    render(){
        return(
            <div className='toolbar'>
                <div className='toolbarleft'>
                    <button className="toolbtn" title="Move Tool" onClick={()=>this.props.choosedTool(1)}>
                        <img src="data:image/png;base64," alt="Move Tool" />
                    </button>
                    <button className="toolbtn" title="Type Tool" onClick={()=>this.TableDis("typeTable")}>
                        <img src="data:image/png;base64," alt="Type Tool"/>
                    </button>
                    <button className="toolbtn" title="Rotate Tool" onClick={(event)=>{
                        this.TableDis("rotateTable");
                        this.props.choosedTool(3)}}><img src="data:image/png;base64," /></button>
                    <button className="toolbtn" title="Crop Tool" onClick={()=>{this.props.choosedTool(4);this.TableDis("cropBox")}}><img src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAKAAAACgAQMAAACxAfVuAAAAAXNSR0IB2cksfwAAAAZQTFRFAAAAAAAApWe5zwAAAAJ0Uk5TAP9bkSK1AAAAUUlEQVR4nO3UIQ4AIAwEwf7/0wVHAEUwhczIlScuosuMnSgWiLkQ7+I8siiKongWy93603HYgigWigAAAAAAAAAAAAAAAAAAAAAAAAAAAPCFBmS+fK5ad48vAAAAAElFTkSuQmCC" alt="Crop Tool"/></button>
                </div>
                <div className='toolbarright'>
                    <button className="toolbtn" title="Paint Tool" onClick={()=>{this.TableDis("paintTable")}}>
                        <img src="data:image/png;base64," alt="Brush Tool" /></button>

                    <button className="toolbtn" title="Shape Tool" onClick={()=>{this.TableDis("shapeList")}}>
                        <img src="data:image/png;base64," alt="Shape" /></button>
                    <div>
                        {this.shapeList()}
                    </div>
                    <button className="toolbtn" title="Component" >7</button>
                    <button className="toolbtn" title="History" ><img src="data:image/png;base64,"/></button>

                </div>
                <div>
                    {this.typeTable()}
                </div>
                <div>
                    {this.rotateTable()}
                </div>
                <div>
                    {this.paintTable()}
                </div>
                <div>
                    {this.shapeTable()}
                </div>
                <div>
                    {this.cropBox()}
                </div>
                </div>
        );
    },
    getComponent(id){
        return document.getElementById(id);
    },

    typeTable(){
        return (
            <div id="typeTable">
                <table >
                    <tr>
                        <td><label>FontSize:</label><input size="4" id='fontSize'/>px</td>
                    </tr>
                    <tr>
                        <td><label>FontWeight:</label>
                            <select id="fontWeight" >
                                <option value="normal">normal</option>
                                <option value="bold">bold</option>
                                <option value="lighter ">lighter</option>
                                <option value="bolder">bolder</option>
                            </select>
                        </td>
                    </tr>
                    <tr>
                        <td>
                            <label>FontStyle:</label>
                            <select id="fontStyle">
                            <option value="normal">normal</option>
                            <option value="oblique">oblique</option>
                            <option value="italic">italic</option>
                            </select>
                        </td>
                     </tr>
                    <tr>
                        <td>
                            <p>Red:<input type="range" id="red" min="0" max="255"
                                          onChange={()=>this.changeColor("text","red","green","blue","showcolor")}/></p>
                            <p>Green:<input type="range" id="green" min="0" max="255"
                                            onChange={()=>this.changeColor("text","red","green","blue","showcolor")}/></p>
                            <p>Blue: <input type="range" id="blue" min="0" max="255"
                                            onChange={()=>this.changeColor("text","red","green","blue","showcolor")}/></p>
                            <p>CurrentColor:<span id="showcolor"></span></p>
                            <p className="colorShow"> <canvas id="text" width="50" height="50"></canvas></p>
                        </td>
                    </tr>
                </table>
                <div className="fontSettingConfirm">
                    <button  onClick = {(event)=>{
                                         this.typeTableClose();
                                         this.props.choosedTool(2);}}>Confirm</button>
                </div>
            </div>
        );
    },
    typeTableClose(){
        let c=this.getComponent("text");
        let ctx = c.getContext("2d");
        let red = this.getComponent("red");
        let green = this.getComponent("green");
        let blue = this.getComponent("blue");
        let fontSize=this.getComponent("fontSize").value;
        let fontWeight=this.getComponent("fontWeight").value;
        let fontStyle=this.getComponent("fontStyle").value;
        ctx.fillStyle = "rgb(" + red.value + "," + green.value + "," + blue.value + ")";
        let currentColor=ctx.fillStyle;
        let fontSetting= () =>this.props.fontSetting(fontSize,currentColor,fontWeight,fontStyle);
        fontSetting(fontSize,currentColor,fontWeight,fontStyle);
        let typeTable=this.getComponent('typeTable');
        typeTable.style.display='none';
    },
    TableDis(id){
        if(lastTable.length==1){
            let tableClose = this.getComponent(lastTable[0]);
            tableClose.style.display = "none";
            lastTable.pop();
            lastTable.push(id);
        }
        else{
            lastTable.push(id);
        }
        let tableDis=this.getComponent(lastTable[0]);
        tableDis.style.display='block';
    },
    rotateTable() {
        return (
            <div id="rotateTable">
                <tr>
                    <td><button id="btnleft" onClick={()=>this.RotateAngle("90")}>Rotate Left</button> </td>
                    <td> <button id="btnright"onClick={()=>this.RotateAngle("-90")}>Rotate Right</button> </td>
                    <td> <button id="btnup" onClick={()=>this.RotateAngle("180")}>Rotate Up</button> </td>
                    <td>  <button id="btndown" onClick={()=>this.RotateAngle("-180")}>Rotate Down</button> </td>
                </tr>
            </div>
        );
    },
   RotateAngle(Angle){
       let rotateAngle= () =>this.props.rotateAngle(Angle);
       rotateAngle(Angle);
   },
    paintTable(){
        return (
            <div id="paintTable">
                <table >
                    <tr>
                        <td><label>Line Width:</label><input size="4" id='lineWidth'/>px</td>
                    </tr>
                    <tr>
                        <td>
                            <p>Red:<input type="range" id="red1" min="0" max="255"
                                          onChange={()=>this.changeColor("text1","red1","green1","blue1","showcolor1")}/></p>
                            <p>Green:<input type="range" id="green1" min="0" max="255"
                                            onChange={()=>this.changeColor("text1","red1","green1","blue1","showcolor1")}/></p>
                            <p>Blue: <input type="range" id="blue1" min="0" max="255"
                                            onChange={()=>this.changeColor("text1","red1","green1","blue1","showcolor1")}/></p>
                            <p>CurrentColor:<span id="showcolor1"></span></p>
                            <p className="colorShow"> <canvas id="text1" width="50" height="50"></canvas></p>
                        </td>
                    </tr>
                </table>
                <div className="fontSettingConfirm">
                    <button  onClick = {()=>{this.props.choosedTool(5);;
                                             this.paintClose()}}>Confirm</button>
                </div>
            </div>
        );
    },
    paintClose(){
        let tableClose = this.getComponent("paintTable");
        let lineWidth=this.getComponent("lineWidth").value;
        let c=this.getComponent("text1");
        let ctx = c.getContext("2d");
        let red = this.getComponent("red1");
        let green = this.getComponent("green1");
        let blue = this.getComponent("blue1");
        ctx.fillStyle = "rgb(" + red.value + "," + green.value + "," + blue.value + ")";
        let currentColor=ctx.fillStyle;
        let lineSetting= () =>this.props.lineSetting(lineWidth,currentColor);
        lineSetting(lineWidth,currentColor);
        tableClose.style.display = "none";
    },
    cropBox(){
       return (
           <div id="cropBox">
               <img scr=""/>
           </div>
       );
    },
    shapeList(){
        return (
          <div id="shapeList" >
                  <ul>
                      <li className="li"><button className="shapeli" onClick={()=>{this.props.shapeSetting("line");this.TableDis("shapeTable")} }>Line</button></li>
                      <li className="li"><button className="shapeli" onClick={()=>{this.props.shapeSetting("rectangle");this.TableDis("shapeTable")}}>Rectangle</button></li>
                      <li className="li"><button className="shapeli" onClick={()=>{this.props.shapeSetting("circle");this.TableDis("shapeTable")}}>Circle</button></li>
                      <li className="li"><button className="shapeli"  onClick={()=>{this.props.shapeSetting("square");this.TableDis("shapeTable")}}>Square</button></li>
                      <li className="li"><button className="shapeli" onClick={()=>{this.props.shapeSetting("RoundRectangle");this.TableDis("shapeTable")}}>Round Rectangle</button></li>
                  </ul>
          </div>
    );
 },

    shapeTable(){
        return <div id="shapeTable">
                <tr>
                    <td>
                        <p>Red:<input type="range" id="red2" min="0" max="255"
                                      onChange={()=>this.changeColor("text2","red2","green2","blue2","showcolor2")}/></p>
                        <p>Green:<input type="range" id="green2" min="0" max="255"
                                        onChange={()=>this.changeColor("text2","red2","green2","blue2","showcolor2")}/></p>
                        <p>Blue: <input type="range" id="blue2" min="0" max="255"
                                        onChange={()=>this.changeColor("text2","red2","green2","blue2","showcolor2")}/></p>
                        <p>CurrentColor:<span id="showcolor2"></span></p>
                        <p className="colorShow"> <canvas id="text2" width="50" height="50"></canvas></p>
                    </td>
                </tr>
            <div className="fontSettingConfirm">
            <button  onClick = {(event)=>{
            this.shapeTableClose();
            this.props.choosedTool(6)}}>Confirm</button>
    </div>
        </div>
    },
    colorPick(){
        return (
            <div id="colorPick">

            </div>
        );
    },
    changeColor(id1,id2,id3,id4,id5) {
        let c = this.getComponent(id1);
        let ctx = c.getContext("2d");
        let red = this.getComponent(id2);
        let green = this.getComponent(id3);
        let blue = this.getComponent(id4);
        ctx.fillStyle = "rgb(" + red.value + "," + green.value + ","
            + blue.value + ")";
        this.getComponent(id5).innerHTML = ctx.fillStyle;
        ctx.fillRect(0, 0, 100, 100);
    },

    shapeTableClose(){
        let tableClose = this.getComponent("shapeTable");
        let c=this.getComponent("text2");
        let ctx = c.getContext("2d");
        let red = this.getComponent("red2");
        let green = this.getComponent("green2");
        let blue = this.getComponent("blue2");
        ctx.fillStyle = "rgb(" + red.value + "," + green.value + "," + blue.value + ")";
        let shapeColor=ctx.fillStyle;
        let shapeColorSetting=()=>this.props.shapeColorSetting(shapeColor);
        shapeColorSetting(shapeColor);
        tableClose.style.display = "none";
    },
});
export default Layer;